Get quick and easy access to all the services provided under your plan, anytime and anywhere with the MSH International mobile app, available in 7 languages :

-          Take a picture of your supporting documents for your claim* directly via the App (*Service only available to insured members benefiting from the remote data exchange system for their supporting documents);
-          View your reimbursement statements in real time;
-          Geolocate nearby healthcare professionals listed by MSH anywhere in the world;
-          Access your personalized insurance card at any time;
-          Learn more about your destination’s culture and healthcare system with our country guides, and receive real-time alerts.

Download the MSH International app now!

Luxembourgish national mobile app to check EU Digital COVID Certificates - The app allows to check in real-time the authenticity and validity of documents issued in the context of the EU Digital COVID Certificate #EUCOVIDCertificate:
• certificate of recovery;
• vaccination certificate;
• test certificate.

The app allows users to:
• scan the QR code on the certificate;
• check the authenticity and the validity of the certificate.
